import React from "react";
import { useState } from "react";
import axios from "axios";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import "./UserLoginStyle.css"
import { Button } from "@mui/material";

const UserLogin = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  let login = () => {
    console.log("Events hits");
    console.log(email);
    console.log(password);
    

    axios
      .post("http://localhost:8080/user/login", { email, password })
      .then((token) => {
        localStorage.setItem("token", token);
        console.log()
      }).catch((err)=>{
        console.log(err.message);
      });
  };


  return (
  <>
    <div className="flex-container">
        <div className="flex-container-child">
            <Box component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '30ch' }, }}
      noValidate
      autoComplete="off"
    >
    <TextField  label="User Name" type="text" variant="outlined" onChange={e=>{
        setEmail(e.target.value)
    }} /> <br />
    <TextField  label="Password" type="password" variant="outlined" onChange={e=>{
        setPassword(e.target.value)}}/>
        <br />
    <Button variant="contained" color="primary" onClick={login}>Login</Button>
    </Box>
    </div>
  </div>
       

  </>
)};

export default UserLogin;
